import { Drawer } from "antd";

const HcpDetailDrawer = ({ data, onClose, open }) => {
  console.log("data", data);
  return (
    <Drawer title={data?.name} onClose={onClose} open={open}>
      <p>Some contents...</p>
      <p>Some contents...</p>
      <p>Some contents...</p>
    </Drawer>
  );
};

export default HcpDetailDrawer;
